import React from 'react';

class SearchBar extends React.Component {
    // Method to observe user input
    onInputChange(event){
        event.target.value
    }

    onInputClick(){
        console.log('ouch!')
    }

    render(){
        return(
            <div className="ui segment">
                <form className="ui form">
                    <div className="field">
                        <label>Imagery</label>
                        <input type="text" placeholder="Anything you want to see today?" onChange={this.onInputChange} onClick={this.onInputClick}/>
                    </div>
                </form>
            </div>
        );
    }
}



export default SearchBar;
